import React from 'react';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';

const Main = () => {

    return (

        <Box

            sx={{
                width: '100%',
                maxWidth: 800,
                height: '100vh',
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                justifyContent: 'center',
                mx: 'auto',
            }
            }
        >
            <Typography variant="h1" gutterBottom>
                Healthy On The Hill
            </Typography>

            <Button variant="contained" color="42a5f5" href="/SignIn">
                Sign In With Google
            </Button>


        </Box >

    );
};

export default Main;
